    <title lang="en">Pages Of Treasures</title>
    <desc lang="en">Bookshop staff FONG HOK MAN (Chun Pui) always believes that “knowledge is power”. He tries hard to encourage his older son FONG SUM MING (Lai Yiu Cheung) and his younger son FONG SUM CHING (Suen Eric) to study more. Unfortunately, MING is not good at studying at all and he quits after secondary school. On the other hand, CHING is a very smart boy and MING works hard overseas to support CHING's further studies on computer sciences in America. The two brothers return to Hong Kong eventually and they work in the same commercial building. CHING works as a senior network security engineer while MING works as a junior security guard. MAN worries that the difference in their job ranking will hinder their relationship. MING admires a girl YUEN WAI CHUNG (Kwok Sonija) who opens a paper mud figure shop. MAN tries to help MING establish his career by buying a secondhand bookshop for him to operate. However, MAN doesn't realize that the virtual world is gradually manipulating his family. CHING meets a romanticist TSU HEI MAN (Yeo Vivien) at work which creates misunderstanding between him and his girlfriend, LUI YUEN YI (Yeung Shirley). MAN's younger daughter FONG SUM MEI (Ho Lily) indulges herself in the virtual world and she is suspected for stealing exam papers on the internet…</desc>
